import React, { useState } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import RBNavbar from "./components/RBNavbar";
import ItemMappingCategories from "./components/ItemMappingCategories";
import ItemDailyUsage from "./components/ItemDailyUsage";

function App() {
  const [counterData, setCounterData] = useState(0);

  function handleDataReceive(data) {
    setCounterData(data);
  }
  return (
    <divx
      className="App"
      style={{
        overflow: "hidden",
      }}
    >
      <RBNavbar counter={counterData} />
      <ItemMappingCategories />
      <ItemDailyUsage setCounterData={handleDataReceive} />
    </divx>
  );
}

export default App;
